function List(props) {
  return (    
      props.store.state.todoitems.map((item,key)=>        
            <li key = {key} className="list-group-item"   > 
                <input type="checkbox" className="float-left my-3" onClick={props.checkmate.bind(this,key)} />  
                <input type="text" value={item.caption} className="myinput" onChange={props.keyPress.bind(this,key)} />              
                <button className="mybtn float-right" onClick ={props.removeItem.bind(this,key)} > X </button>               
      </li>       
      )
  )
}

export default List;
